import React from "react";
function Analysis() {
  return (
    <div className="sbody">
      <div className="all">
          <div className="menuBtn">
            <button className="Bt">여행지</button>
            <button className="Bt">음식점</button>
            <button className="Bt">숙박</button>
            <button className="Bt">기타</button>
            
            
          </div> 
      </div>
    </div>
  );
}

export default Analysis;
